INSERT INTO `news` VALUES (1,1,'Keep calm and victory is yours!','Друзі, долучайтесь до нашого конкурсу та вигравайте квитки до кінотеатру IMAX!\r\nУмови участі: \r\n1. Вступити до групи https://vk.com/happycakeua\r\n2. Зробити репост цієї публікації			3. Чекати на розіграш подарунків 15 березня!','2016-04-14','акция, конкурс',17,'   '),(2,1,'Збери собі обід у Happy Cake!','Один із варіантів смачного обіду на вибір: 1. Салат овочевий - 24 гривні. 2. Чізбургер - 19 гривень. 3. Грог безалкогольний - 17 гривень. Чудовий комлексний обід всього за 60 гривень!','2016-04-16','меню, обед',10,'  '),(3,1,'Рецепт кави з книги 1844 року','Столову ложку порошку в півлітра окропу, кипятити 20-25 хвилин. \r\n				Залишити настоятися 4-5 хвилин. Додайте рибну шкірку, шматочок рибячого жиру або половину яйця\r\n				Як добре, що у Happy Cake рецептура дещо інша.\r\n				Завітайте до нас на смачненьку каву.','2016-03-09','рецепти, кава',8,'  '),(4,1,'Із напоєм у подарунок!','У цю середу приходьте до нас на обід та отримайте напій у подарунок. Не зволікайте: акція діє тільки у цю середу','2016-05-04','меню, обед',8,'  ');
