INSERT INTO `reports` VALUES (1,'Марина','Понравилось заведение: довольно примечательный интерьер и вкусная выпечка','2016-05-14','','','+'),(2,'Кристина','Проходили мимо с подругой, решили зайти. Цены адекватные, кофе неплохой','2016-05-14','','','+'),(3,'Афанасий','Одно из моих любимых мест. Можно плотно отобедать и выпить чашечку ароматного латте','2016-05-14','','','+'),(4,' Владислав','ВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладислав','2016-05-05','','','0'),(5,'Владислав','ВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладиславВладислав','2016-05-05','shyshkin_vlad@yahoo.com','+380935825956','0'),(6,'Курлик','ВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВасяВася','2016-05-05','shyslav@gmail.com','+380935825956','0'),(7,'Иван','Ваша кухня самая лучшая. Только у вас на территории КПИ можно получить свежую выпечку с множеством начинки. Спасибо!','2016-05-06','ivan@mail.ru','+380935825956','+'),(8,'Кирил','Супер заведение. Можно хорошо покушать. Грибной суп реально крутой. Люблю это место. Персонал радует, не хамят, и такие приветливые.','2016-05-06','kiril@mail.ru','+380935825956','+'),(9,'Марина','На мою думку, кафе гарне. Але іноді доволі довго треба чекати.','2016-05-10','marina@gmail.com','+380913030595','+'),(10,'Марина','hgAKnd.ashfncsad.fhnsadkfhawsdifhasod;ifhwsdo;ifhsd;oifhsdo;ifhsd;oifhasdoi;fawjf','2016-05-20','marina@gmail.com','+380956784577','-');
